import React, { useState } from "react";
import { motion } from "framer-motion";
import {
  SparklesIcon,
  FunnelIcon,
  ArrowTrendingUpIcon,
  ChartBarIcon,
  DocumentArrowDownIcon,
  BoltIcon,
  HomeIcon,
} from "@heroicons/react/24/outline";

import Header from "./components/Header";
import Scraper from "./pages/Scraper";
import DataCleaning from "./pages/DataCleaning";
import DataTransformation from "./pages/DataTransformation";
import EDA from "./pages/EDA";
import Predictions from "./pages/Predictions";
import Evaluation from "./pages/Evaluation";
import Export from "./pages/Export";

function App() {
  const [activeModule, setActiveModule] = useState(null);

  const modules = [
    {
      id: "scraper",
      name: "Data Collection",
      description: "Gather sports data from APIs and datasets",
      icon: HomeIcon,
      color: "from-blue-500 to-blue-600",
    },
    {
      id: "cleaning",
      name: "Data Cleaning",
      description: "Handle missing values and duplicates",
      icon: FunnelIcon,
      color: "from-green-500 to-green-600",
    },
    {
      id: "transformation",
      name: "Data Transformation",
      description: "Feature engineering and normalization",
      icon: ArrowTrendingUpIcon,
      color: "from-purple-500 to-purple-600",
    },
    {
      id: "eda",
      name: "Exploratory Analysis",
      description: "Visualize trends and insights",
      icon: ChartBarIcon,
      color: "from-orange-500 to-orange-600",
    },
    {
      id: "predictions",
      name: "Modeling",
      description: "Apply ML algorithms",
      icon: SparklesIcon,
      color: "from-pink-500 to-pink-600",
    },
    {
      id: "evaluation",
      name: "Evaluation",
      description: "Model accuracy and validation",
      icon: BoltIcon,
      color: "from-red-500 to-red-600",
    },
    {
      id: "export",
      name: "Export Results",
      description: "Download reports and datasets",
      icon: DocumentArrowDownIcon,
      color: "from-indigo-500 to-indigo-600",
    },
  ];

  const renderModulePage = () => {
    switch (activeModule) {
      case "scraper":
        return <Scraper />;
      case "cleaning":
        return <DataCleaning />;
      case "transformation":
        return <DataTransformation />;
      case "eda":
        return <EDA />;
      case "predictions":
        return <Predictions />;
      case "evaluation":
        return <Evaluation />;
      case "export":
        return <Export />;
      default:
        return null;
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {!activeModule ? (
        <>
          <Header />

          {/* HERO SECTION */}
          <section className="relative min-h-screen flex items-center justify-center overflow-hidden text-white">
            {/* Background Image */}
            <div
              className="absolute inset-0 bg-cover bg-center"
              style={{
                backgroundImage:
                  "url('https://images.unsplash.com/photo-1540747913346-19e32dc3e97e?auto=format&fit=crop&w=1950&q=80')",
              }}
            ></div>

            {/* Overlay */}
            <div className="absolute inset-0 bg-gradient-to-r from-black/80 via-black/70 to-black/80"></div>

            {/* Content */}
            <div className="relative z-10 container mx-auto px-6 text-center">
              <motion.div
                initial={{ opacity: 0, y: -30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.8 }}
              >
                <div className="flex justify-center mb-6">
                  <div className="bg-white/10 backdrop-blur-lg rounded-full p-6 animate-float shadow-xl">
                    <SparklesIcon className="w-14 h-14 text-white" />
                  </div>
                </div>

                <h1 className="text-4xl md:text-6xl font-bold mb-6 bg-gradient-to-r from-white to-primary-300 bg-clip-text text-transparent">
                  AI-Driven Sports Insights Platform
                </h1>

                <p className="text-lg md:text-2xl text-gray-200 mb-10 max-w-3xl mx-auto">
                  Advanced Cricket Analytics Pipeline powered by Machine Learning
                </p>

                <div className="flex flex-col md:flex-row justify-center gap-6">
                  <div className="bg-white/10 backdrop-blur-md px-8 py-4 rounded-xl shadow-lg">
                    <div className="text-3xl font-bold text-primary-400">7</div>
                    <div className="text-sm text-gray-300">Pipeline Stages</div>
                  </div>

                  <div className="bg-white/10 backdrop-blur-md px-8 py-4 rounded-xl shadow-lg">
                    <div className="text-3xl font-bold text-secondary-400">50K+</div>
                    <div className="text-sm text-gray-300">Data Points</div>
                  </div>

                  <div className="bg-white/10 backdrop-blur-md px-8 py-4 rounded-xl shadow-lg">
                    <div className="text-3xl font-bold text-accent-400">95%</div>
                    <div className="text-sm text-gray-300">Model Accuracy</div>
                  </div>
                </div>
              </motion.div>
            </div>
          </section>

          {/* MODULE GRID */}
          <div className="py-20 container mx-auto px-6">
            <h2 className="text-4xl font-bold text-center mb-16 text-gray-800">
              Analytics Pipeline
            </h2>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-10">
              {modules.map((module, index) => {
                const Icon = module.icon;
                return (
                  <motion.div
                    key={module.id}
                    initial={{ opacity: 0, y: 40 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ delay: index * 0.1 }}
                    onClick={() => setActiveModule(module.id)}
                    className="cursor-pointer bg-white rounded-2xl shadow-lg hover:shadow-2xl transition-all duration-500 overflow-hidden"
                  >
                    <div
                      className={`bg-gradient-to-br ${module.color} p-8 flex justify-center`}
                    >
                      <Icon className="w-12 h-12 text-white" />
                    </div>

                    <div className="p-6">
                      <h3 className="text-xl font-bold mb-2 text-gray-800">
                        {module.name}
                      </h3>
                      <p className="text-gray-600">{module.description}</p>
                    </div>
                  </motion.div>
                );
              })}
            </div>
          </div>

          {/* FOOTER */}
          <footer className="bg-gray-900 text-gray-400 text-center py-6">
            Â© 2026 AI-Driven Sports Insights Platform
          </footer>
        </>
      ) : (
        renderModulePage()
      )}
    </div>
  );
}

export default App;
